import React, {useState} from 'react';
import {data} from '../../data';

const Nav = () => {
    const [header, useHeader] = useState(data);
    console.log("data is" + header);
    return (
        <nav className="container">
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>Contact</li>
            </ul>
        </nav>
    )
}

export default Nav
